;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/metrics</span>","value":"#'algebolic.demo.simple-sr/metrics"}
;; <=

;; @@
(time (def result (evolution/run-evolution run-config metrics)))
